import React from "react";

const Test = () => {
  return (
    <div>
      <section class="hero is-primary is-medium">
        <Navbar />
        <div class="hero-body">
          <div class="container has-text-centered">
            <h1 class="title">Title</h1>
            <h2 class="subtitle">Subtitle</h2>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Test;
